import React from 'react';
import { Route } from 'react-router-dom';
import Signup from './Signup';
import Login from './Login';

function AuthRoutes() {
  return (
    <>
      <Route path='/register' element={<Signup />} />
      <Route path='/login' element={<Login />} />
    </>
  );
}

export default AuthRoutes;
